        {
            _toggleButtonLabel = "Show Filters";
        }
        else
        {
            _toggleButtonLabel = "Hide Filters";
        }
    }

    private async Task OnReset(EventArgs e)
    {
        await OnResetFiltersEvent.InvokeAsync(e);
        _filterModel = new();
    }

